/** defaults used in listing */
export const settingsDefaults = {
  configurations: [],
  enabled: true,
}

/** defaults used on add/edit configuration */
export const configurationDefaults = {
  // id: '', - uuid gets populated upon creation
  enabled: true,
  name: '',
  type: 'IPLIST',
  source: '',
  pollingUnit: 'Days', // possible values: "Minutes", "Hours", "Days", "Months"
  pollingTime: null, // computed based on Unit
  skipCertCheck: false,
  // this is parsing for the blocklist. This is the default option, which grabs the first non-whitespace string in the list, and IP validation is handled later.
  parsingMethod: '^\\S{2,256}',
}
